import React from "react";
import { useLocation } from "react-router-dom";

const FinalPage = () => {
  const location = useLocation();
  const { section1Values, section2Value, section3Value } = location.state;

  return (
    <div>
      <h1>Final Page</h1>

      <h2>Section 1:</h2>
      {/* Check if section1Values is an array before mapping */}
      {Array.isArray(section1Values) && (
        <ul>
          {section1Values.map((value, index) => (
            <li key={index}>{value}</li>
          ))}
        </ul>
      )}

      {/* Display other values as before */}
      <p>Section 2: {section2Value}</p>
      <p>Section 3: {section3Value}</p>
    </div>
  );
};

export default FinalPage;
